        public static bool ExisteDB(string nombreDB, Microsoft.Data.Sqlite.SqliteConnection connection)
        {

            using (var command = new SqliteCommand($"SELECT db_id('" + nombreDB + "')", connection))
            {
                connection.Open();
                return (command.ExecuteScalar() != DBNull.Value);
            }
            
        }

        public static bool ExisteTabla(String tableName, Microsoft.Data.Sqlite.SqliteConnection connection)
        {
            using (SqliteCommand cmd = new SqliteCommand())
            {
                cmd.CommandType = CommandType.Text;
                cmd.Connection = connection;
                cmd.CommandText = "SELECT * FROM sqlite_master WHERE type = 'table' AND name = @name";
                cmd.Parameters.AddWithValue("@name", tableName);

                using (SqliteDataReader sqlDataReader = cmd.ExecuteReader())
                {
                    if (sqlDataReader.Read())
                        return true;
                    else
                        return false;
                }
            }
        }

